rif; font-size: 13px;\"><div class=\"Pb(16px) Bgc(c-white)\" style=\"word-break: break-word; overflow-wrap: break-word; min-width: 0px; background-color: var(--c-white); padding-bottom: 16px;\"><article class=\"Lh(1.4) Fz(16px)\" itemprop=\"articleBody\" style=\"word-break: break-word; overflow-wrap: break-word; min-width: 0px; font-size: 16px; line-height: 1.4;\"><div style=\"word-break: break-word; overflow-wrap: break-word; min-width: 0px; text-align: center;\"><img src=\"https://s.kaskus.id/images/2020/12/15/8701698_20201215084847.jpg\" border=\"0\" alt=\"Eits, Google Chrome Akan Disuntik Mati Pada 2022 Gara-Gara Ini?\" style=\"word-break: break-word; overflow-wrap: break-word; min-width: 0px; height: auto; max-width: 100%; vertical-align: bottom;\"><br style=\"word-break: break-word; overflow-wrap: break-word; min-width: 0px;\"><br style=\"word-break: break-word; overflow-wrap: break-word; min-width: 0px;\"><span data-attr=\"size\" data-value=\"v_5\" style=\"word-break: break-word; overflow-wrap: break-word; min-width: 0px; font-size: 20px !important;\">Ada beberapa alasan mengapa orang lebih memilih browser favoritnya digunakan sehari-hari untuk mencari informasi atau sekedar bersenang-senang di dunia maya, salah satunya menggunakan browser terkenal Google Chrome karena didukung penuh oleh Google, ringan, aman, terintegrasi oleh smartphone dan lainnya.</span><br style=\"word-break: break-word; overflow-wrap: break-word; min-width: 0px;\"><br style=\"word-break: break-word; overflow-wrap: break-word; min-width: 0px;\"><span data-attr=\"size\" data-value=\"v_5\" style=\"word-break: break-word; overflow-wrap: break-word; min-width: 0px; font-size: 20px !important;\">Browser Google Chrome sendiri menurut&nbsp;<em style=\"word-break: break-word; overflow-wrap: break-word; min-width: 0px;\">pcmag</em>, menjadi salah satu pemain kuat yang menguasai pasar hingga 70% dibanding Edge, Firefox, Opera, atau Safari, dan mencaplok 60% untuk versi mobilenya.</span><br style=\"word-break: break-word; overflow-wrap: break-word; min-width: 0px;\"><br style=\"word-break: break-word; overflow-wrap: break-word; min-width: 0px;\"><span data-attr=\"size\" data-value=\"v_4\" style=\"word-break: break-word; overflow-wrap: break-word; min-width: 0px; font-size: 18px !important;\">Tapi belum lama ini ada kabar kurang bagus bagi pecinta browser Google Chrome, Google sang pemilik browser ini kabarnya akan menyuntik mati browser Google Chrome pada 2022 mendatang. Kok bisa?</span><br style=\"word-break: break-word; overflow-wrap: break-word; min-width: 0px;\"><br style=\"word-break: break-word; overflow-wrap: break-word; min-width: 0px;\"><span data-attr=\"size\" data-value=\"v_4\" style=\"word-break: break-word; overflow-wrap: break-word; min-width: 0px; font-size: 18px !important;\"><img src=\"https://s.kaskus.id/images/2020/12/15/8701698_20201215085103.jpg\" border=\"0\" alt=\"Eits, Google Chrome Akan Disuntik Mati Pada 2022 Gara-Gara Ini?\" style=\"word-break: break-word; overflow-wrap: break-word; min-width: 0px; height: auto; max-width: 100%; vertical-align: bottom;\"></span><br style=\"word-break: break-word; overflow-wrap: break-word; min-width: 0px;\"><br style=\"word-break: break-word; overflow-wrap: break-word; min-width: 0px;\"><span data-attr=\"size\" data-value=\"v_4\" style=\"word-break: break-word; overflow-wrap: break-word; min-width: 0px; font-size: 18px !important;\">Ini bukan berita hoax, saudara. Pihak Google secara resmi tidak akan lagi mengupdate atau mendukung Google Chrome bagi pengguna pc di Windows 7, lebih tepatnya akan dihentikan layanannya pada 15 Januari 2022 dari yang seharusnya akan disuntik mati pada 15 Juli 2021.</span><br style=\"word-break: break-word; overflow-wrap: break-word; min-width: 0px;\"><br style=\"word-break: break-word; overflow-wrap: break-word; min-width: 0px;\"><span data-attr=\"size\" data-value=\"v_4\" style=\"word-break: break-word; overflow-wrap: break-word; min-width: 0px; font-size: 18px !important;\">Dampak negatif tidak disupportnya lagi browser Google Chrome oleh Google, maka pihak Google tidak lagi menjamin sistem keamanan saat menggunakan browser Google Chrome ini.</span><br style=\"word-break: break-word; overflow-wrap: break-word; min-width: 0px;\"><br style=\"word-break: break-word; overflow-wrap: break-word; min-width: 0px;\"><span data-attr=\"size\" data-value=\"v_4\" style=\"word-break: break-word; overflow-wrap: break-word; min-width: 0px; font-size: 18px !important;\">Alasan utama mengapa browser Google Chrome harus di suntik mati pada 1 Januari 2022 mendatang tidak dijelaskan secara spesifik oleh Google namun clue-nya lebih kepada kendala sulitnya Google Chrome berkembang dan beradaptasi dengan Windows 7 ketika menerima tuntutan IT yang semakin dinamis saat ini.</span><br style=\"word-break: break-word; overflow-wrap: break-word; min-width: 0px;\"><br style=\"word-break: break-word; overflow-wrap: break-word; min-width: 0px;\"><span data-attr=\"size\" data-value=\"v_4\" style=\"word-break: break-word; overflow-wrap: break-word; min-width: 0px; font-size: 18px !important;\">Ya, sebenarnya menurut saya yang namanya bisnis apapun bentuk dan aplikasinya memang mau-tidak mau harus beradaptasi dengan situasi dan kondisi.</span><br style=\"word-break: break-word; overflow-wrap: break-word; min-width: 0px;\"><br style=\"word-break: break-word; overflow-wrap: break-word; min-width: 0px;\"><span data-attr=\"size\" data-value=\"v_4\" style=\"word-break: break-word; overflow-wrap: break-word; min-width: 0px; font-size: 18px !important;\"><img src=\"https://s.kaskus.id/images/2020/12/15/8701698_20201215085216.jpg\" border=\"0\" alt=\"Eits, Google Chrome Akan Disuntik Mati Pada 2022 Gara-Gara Ini?\" style=\"word-break: break-word; overflow-wrap: break-word; min-width: 0px; height: auto; max-width: 100%; vertical-align: bottom;\"></span><br style=\"word-break: break-word; overflow-wrap: break-word; min-width: 0px;\"><br style=\"word-break: break-word; overflow-wrap: break-word; min-width: 0px;\"><span data-attr=\"size\" data-value=\"v_4\" style=\"word-break: break-word; overflow-wrap: break-word; min-width: 0px; font-size: 18px !important;\">Terlebih bagi Google yang memiliki ratusan aplikasi yang nyaris mendominasi teknologi IT mobile, tentu tidak ingin direpotkan dan disibukkan dengan hal yang telah dianggap \'buntu\' dan gagap terhadap tuntutan kebutuhan pasar.</span><br style=\"word-break: break-word; overflow-wrap: break-word; min-width: 0px;\"><br style=\"word-break: break-word; overflow-wrap: break-word; min-width: 0px;\"><span data-attr=\"size\" data-value=\"v_4\" style=\"word-break: break-word; overflow-wrap: break-word; min-width: 0px; font-size: 18px !important;\">Menurut saya (lagi) apa yang dilakukan oleh Google adalah hal yang biasa terjadi di dunia teknologi. Microsoft salah satu \'<em style=\"word-break: break-word; overflow-wrap: break-word; min-width: 0px;\">mbahnya</em>\' operasi sistem dulunya sering melakukan perubahan dan kebijakan demi kelangsungan dan kemudahan pakai bagi pengguna.</span><br style=\"word-break: break-word; overflow-wrap: break-word; min-width: 0px;\"><br style=\"word-break: break-word; overflow-wrap: break-word; min-width: 0px;\"><span data-attr=\"size\" data-value=\"v_4\" style=\"word-break: break-word; overflow-wrap: break-word; min-width: 0px; font-size: 18px !important;\">Dunia teknologi memang selalu dinamis. Tapi bagi pengguna awam mungkin tidak akan mengetahui bagaimana proses berkembangnya sebuah aplikasi agar mudah dan nyaman digunakan.</span><br style=\"word-break: break-word; overflow-wrap: break-word; min-width: 0px;\"><br style=\"word-break: break-word; overflow-wrap: break-word; min-width: 0px;\"><span data-attr=\"size\" data-value=\"v_4\" style=\"word-break: break-word; overflow-wrap: break-word; min-width: 0px; font-size: 18px !important;\">Tapi bagi mereka yang melek IT tentu perubahan ini memiliki dampak yang terasa, sistem kerja mereka otomatis harus mengikuti perubahan agar dukungan, komunikasi, bisnis, dan keamanan mereka tetap terjamin lancar dari gangguan oknum jahat yang suatu saat bisa saja menginfeksi virus ke daya internal mereka.</span><br style=\"word-break: break-word; overflow-wrap: break-word; min-width: 0px;\"><br style=\"word-break: break-word; overflow-wrap: break-word; min-width: 0px;\"><span data-attr=\"size\" data-value=\"v_4\" style=\"word-break: break-word; overflow-wrap: break-word; min-width: 0px; font-size: 18px !important;\">Jadi buat kamu pemakai browser Google Chrome di Windows 7 sebaiknya segera saja upgrade OS ke Windows 10 dimana Google Chrome sendiri sudah sepaket dan terbaru.</span><br style=\"word-break: break-word; overflow-wrap: break-word; min-width: 0px;\"><br style=\"word-break: break-word; overflow-wrap: break-word; min-width: 0px;\"><span data-attr=\"size\" data-value=\"v_4\" style=\"word-break: break-word; overflow-wrap: break-word; min-width: 0px; font-size: 18px !important;\"><img src=\"https://s.kaskus.id/images/2020/12/15/8701698_20201215085617.jpg\" border=\"0\" alt=\"Eits, Google Chrome Akan Disuntik Mati Pada 2022 Gara-Gara Ini?\" style=\"word-break: break-word; overflow-wrap: break-word; min-width: 0px; height: auto; max-width: 100%; vertical-align: bottom;\"></span><br style=\"word-break: break-word; overflow-wrap: break-word; min-width: 0px;\"><br style=\"word-break: break-word; overflow-wrap: break-word; min-width: 0px;\"><span data-attr=\"size\" data-value=\"v_4\" style=\"word-break: break-word; overflow-wrap: break-word; min-width: 0px; font-size: 18px !important;\">Atau jika spek Pc/laptop mu sudah pas-pasan atau ingin tetap bertahan di Windows 7 lebih baik mencoba browser lain yang tidak kalah bagus dan menarik. Silahkan memilih karena hidup adalah pilihan.&nbsp;<em style=\"word-break: break-word; overflow-wrap: break-word; min-width: 0px;\">Mhuehehe...&nbsp;<img src=\"https://s.kaskus.id/images/smilies/sumbangan/13.gif\" data-sceditor-emoticon=\";)\" border=\"0\" 